    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE col1 NOT IN ( - col2 * - col0, 4 * + col2, - 14 * - - 36 * - - 74 );
  - name: tab2

outputs:
  - name: q8695.out
    data: |
      46	51	23
      64	77	40
      75	67	58
